		else {
			if (hsv.S>base.S) this.dS = (hsv.S-base.S)/(1-base.S)
			else this.dS = hsv.S / base.S - 1;
			}
		if (base.V==0) this.dV = 0;
		else {
			if (hsv.V>base.V) this.dV = (hsv.V-base.V)/(1-base.V)
