		if (str.length>k) {
			var colNr,varNr,S,V;

			while (str.length>k) {
				// 1 int - idx
				a = str.substring(k,k+1);
				a = myB64.decodeInt(a);
				colNr = Math.floor(a/8);
				varNr = a-colNr*8;
				if (colNr<0 || colNr>3 || varNr<0 || varNr>4) return false;
				k += 1;
				// 2 float - S
