				k += 2;
				// 2 float - V
				a = str.substring(k,k+2);
				V = myB64.decodeFloat(a,2,5)*2-1;
				if (V<-1 || V>1) return false;
				k += 2;
				this.setVarOverlay(colNr,varNr,S,V,true);
