		}
	else if (elm.id=='contrast') {
	// -0.5..0.5 => 0..1
		var cL = x + 0.5;
		var cS = 0.5 - y;
		Palette.setContrast(cS,cL);
		updateContrast();
		}
	if ($('#presets select').get(0).selectedIndex!=0) {
		$('#presets select').get(0).selectedIndex = 0;
		$('#presets select').trigger('change');
		}
	}
